import React from 'react';

function Test02({ onClick }) {

    const handlingClick = (e) => {
        const value = e.target.innerText;
        onClick(value);
    }

    return (
        <>
            <button onClick={handlingClick}>Búa</button>
            <button onClick={handlingClick}>Kéo</button>
            <button onClick={handlingClick}>Bao</button>
        </>
    );
}

export default Test02;
